INSERT INTO `park` VALUES (_binary '\∆\√\¥\Á\Íës]˚\ˆ\≈ay','8056585730','Channel Islands National Park encompasses five remarkable islands and their ocean environment, preserving and protecting a wealth of natural and cultural resources. Isolation over thousands of years has created unique animals, plants, and archeological resources found nowhere else on Earth and helped preserve a place where visitors can experience coastal southern California as it once was.','Channel Islands National Park','CA','The park is open 24 hours a day. Services and facilities have separate hours. Please see descriptions of those facilities elsewhere.'),(_binary '\∆\Î\0¥\Á\Íës]˚\ˆ\≈ay','9064820984','Explore a rugged, isolated island, far from the sights and sounds of civilization. Surrounded by Lake Superior, Isle Royale offers unparalleled solitude and adventures for backpackers, hikers, boaters, kayakers, canoeists and scuba divers. Here, amid stunning scenic beauty, you\'ll find opportunities for reflection and discovery, and make memories that last a lifetime.','Isle Royale National Park','MI','The Isle Royale National Park archipelago in Lake Superior is open April 16 - October 31 (every year).\n\nDue to COVID-19 the park is closed until further notice.'),(_binary '\«¥\Á\Íës]˚\ˆ\≈ay','7603675500','Two distinct desert ecosystems, the Mojave and the Colorado, come together in Joshua Tree National Park. A fascinating variety of plants and animals make their homes in a land sculpted by strong winds and occasional torrents of rain. Dark night skies, a rich cultural history, and surreal geologic features add to the wonder of this vast wilderness in southern California. Come explore for yourself.','Joshua Tree National Park','CA','Joshua Tree National Park is open 24 hours a day and may be visited at any time of the year. Visitation increases as temperatures moderate in the fall, peaks during the spring wildflower season, and diminishes during the heat of summer. Some areas of the park are designated for day use only. Visitor centers keep separate hours; please see descriptions.'),(_binary '\«¥\Á\Íës]˚\ˆ\≈ay','9074423890','Caribou, sand dunes, the Kobuk River, Onion Portage - just some of the facets of Kobuk Valley National Park. Half a million caribou migrate through, their tracks crisscrossing sculpted dunes. The Kobuk River is an ancient and current path for people and wildlife. For 9000 years, people came to Onion Portage to harvest caribou as they swam the river. Even today, that rich tradition continues.','Kobuk Valley National Park','AK','The Northwest Arctic Heritage Center is the visitor center for Kobuk Valley National Park.  Since there are no roads in to Kobuk Valley, the visitor center is located in Kotzebue, AK.  From Kotzebue, visitors will charter an air taxi to transport them into the actual national park which is open 24/7 every day of the year.'),(_binary '\«9 ¥\Á\Íës]˚\ˆ\≈ay','4357723256','Follow the paths where ancient native people and pioneers walked. Gaze up at massive sandstone cliffs of cream, pink, and red that soar into a brilliant blue sky. Experience wilderness in a narrow slot canyon. Zion‚Äôs unique array of plants and animals will enchant you as you absorb the rich history of the past and enjoy the excitement of present day adventures.','Zion National Park','UT','Zion National Park is open every day of the year.'),(_binary 'ûä∂p¥\Ê\Íës]˚\ˆ\≈ay','4358345322','Hoodoos (irregular columns of rock) exist on every continent, but here is the largest concentration found anywhere on Earth. Situated along a high plateau at the top of the Grand Staircase, the park\'s high elevations include numerous life communities, fantastic dark skies, and geological wonders that defy description.','Bryce Canyon National Park','UT','Visitor Center and Fee Booths are closed on Thanksgiving and Christmas Day.'),(_binary 'ûä›Ä¥\Ê\Íës]˚\ˆ\≈ay','4407173890','Though a short distance from the urban areas of Cleveland and Akron, Cuyahoga Valley National Park seems worlds away. The park is a refuge for native plants and wildlife, and provides routes of discovery for visitors. The winding Cuyahoga River gives way to deep forests, rolling hills, and open farmlands. Walk or ride the Towpath Trail to follow the historic route of the Ohio & Erie Canal.','Cuyahoga Valley National Park','OH','Cuyahoga Valley National Park is open everyday, 24 hours a day with the following exceptions:  Brandywine Falls, Virginia Kendall Ledges, Octagon, and Lake close from dusk until morning opening.'),(_binary 'ûãê¥\Ê\Íës]˚\ˆ\≈ay','3052427700','Almost 70 miles (113 km) west of Key West lies the remote Dry Tortugas National Park. This 100-square mile park is mostly open water with seven small islands.  Accessible only by boat or seaplane, the park is known the world over as the home of magnificent Fort Jefferson, picturesque blue waters, superlative coral reefs and marine life, and the vast assortment of bird life that frequents the area.','Dry Tortugas National Park','FL','The Dry Tortugas is open 24 hours, 7 days a week. This includes holidays.'),(_binary 'ûãë¥\Ê\Íës]˚\ˆ\≈ay','9074220500','At the edge of the Kenai Peninsula lies a land where the ice age lingers. Nearly 40 glaciers flow from the Harding Icefield, Kenai Fjords\' crowning feature. Wildlife thrives in icy waters and lush forests around this vast expanse of ice. Sugpiaq people relied on these resources to nurture a life entwined with the sea. Today, shrinking glaciers bear witness to the effects of our changing climate.','Kenai Fjords National Park','AK','The park is open year-round.  The primary months to visit are June, July, and August.  There are reduced services in the area during the months of May and September.\n\nThe road to the Exit Glacier area is not plowed during the winter months, and is closed to vehicle traffic once it is covered in snow and ice.\n\nThe park\'s coastal backcountry in also largely inaccessible late fall through the early spring due to rough seas.'),(_binary 'ûã+†¥\Ê\Íës]˚\ˆ\≈ay','7016234466','When Theodore Roosevelt came to Dakota Territory to hunt bison in 1883, he was a skinny, young, spectacled dude from New York. He could not have imagined how his adventure in this remote and unfamiliar place would forever alter the course of the nation. The rugged landscape and strenuous life that TR experienced here would help shape a conservation policy that we still benefit from today.','Theodore Roosevelt National Park','ND','Theodore Roosevelt National Park is open 24 hours a day, every day of the year. Even when entrance stations and visitor centers are closed, the park itself remains open.'),(_binary '™≤H\¥\Ê\Íës]˚\ˆ\≈ay','6054335361','The rugged beauty of the Badlands draws visitors from around the world. These striking geologic deposits contain one of the world‚Äôs richest fossil beds. Ancient horses and rhinos once roamed here. The park‚Äôs 244,000 acres protect an expanse of mixed-grass prairie where bison, bighorn sheep, prairie dogs, and black-footed ferrets live today.','Badlands National Park','SD','The park is open to visitors all year with the exception of weather closures.'),(_binary '™≤p\0¥\Ê\Íës]˚\ˆ\≈ay','432-477-2251','There is a place in Far West Texas where night skies are dark as coal and rivers carve temple-like canyons in ancient limestone. Here, at the end of the road, hundreds of bird species take refuge in a solitary mountain range surrounded by weather-beaten desert. Tenacious cactus bloom in sublime southwestern sun, and diversity of species is the best in the country. This magical place is Big Bend...','Big Bend National Park','TX','Park entrances are open 24 hours daily, all year.'),(_binary '™≤p¥\Ê\Íës]˚\ˆ\≈ay','435-719-2313','Canyonlands invites you to explore a wilderness of countless canyons and fantastically formed buttes carved by the Colorado River and its tributaries. Rivers divide the park into four districts: Island in the Sky, The Needles, The Maze, and the rivers themselves. These areas share a primitive desert atmosphere, but each offers different opportunities for sightseeing and adventure.','Canyonlands National Park','UT','Canyonlands National Park is generally open 24 hours a day, year-round.'),(_binary '™≤ó¥\Ê\Íës]˚\ˆ\≈ay','3605692211','Ascending to 14,410 feet above sea level, Mount Rainier stands as an icon in the Washington landscape. An active volcano, Mount Rainier is the most glaciated peak in the contiguous U.S.A., spawning five major rivers. Subalpine wildflower meadows ring the icy volcano while ancient forest cloaks Mount Rainier‚Äôs lower slopes. Wildlife abounds in the park‚Äôs ecosystems. A lifetime of discovery awaits.','Mount Rainier National Park','WA','Mount Rainier National Park is open all year. Visitation peaks in July and August with warmer weather and  blooming wildflowers. In spring and autumn, weather determines the availability of facilities and roads. During winter months a number of roads, facilities, and entrances close for the season.'),(_binary '™≤ó¥\Ê\Íës]˚\ˆ\≈ay','9285246228','Did you know that Petrified Forest is more spectacular than ever? While the park has all the wonders known for a century, there are many new adventures and discoveries to share. There are backcountry hikes into areas never open before such as Red Basin and little known areas like the Martha\'s Butte. There are new exhibits that bring the stories to life. Come rediscover Petrified Forest!','Petrified Forest National Park','AZ','Park Road hours of operation. Closed Dec. 25.'),(_binary '™≤æ ¥\Ê\Íës]˚\ˆ\≈ay','9705861206','Rocky Mountain National Park‚Äôs 415 square miles encompass and protect spectacular mountain environments. Enjoy Trail Ridge Road ‚Äì which crests at over 12,000 feet including many overlooks to experience the subalpine and alpine worlds ‚Äì along with over 300 miles of hiking trails, wildflowers, wildlife, starry nights, and fun times. In a world of superlatives, Rocky is on top!','Rocky Mountain National Park','CO','While certain roads and facilities may be closed, the park is open 24 hours a day, 365 days a year.'),(_binary '™≤æ!¥\Ê\Íës]˚\ˆ\≈ay','5754796124','Rising from the heart of the Tularosa Basin is one of the world\'s great natural wonders - the glistening white sands of New Mexico. Great wave-like dunes of gypsum sand have engulfed 275 square miles of desert, creating the world\'s largest gypsum dunefield. White Sands National Park preserves a major portion of this unique dunefield, along with the plants and animals that live here.','White Sands National Park','NM','Park hours change throughout the year. Gates always open at 7:00 am with closing hours changing with the seasons.'),(_binary '™≤\Â0¥\Ê\Íës]˚\ˆ\≈ay','2093720200','Not just a great valley, but a shrine to human foresight, the strength of granite, the power of glaciers, the persistence of life, and the tranquility of the High Sierra.\n\nFirst protected in 1864, Yosemite National Park is best known for its waterfalls, but within its nearly 1,200 square miles, you can find deep valleys, grand meadows, ancient giant sequoias, a vast wilderness area, and much more.','Yosemite National Park','CA','Due to current health guidelines, if you are driving a vehicle into Yosemite National Park, you must pay the park entrance fee and have a day-use reservation (valid for 7 consecutive days for unlimited entries); Upper Pines Campground or Wawona Horse Camp reservation; Yosemite Valley Lodge, Curry Village, or The Ahwahnee reservation; private lodging or vacation rental reservation in Wawona, Yosemite West, or Foresta; Yosemite wilderness permit; Yosemite Half Dome permit; or a commercial use authorization.'),(_binary 'µ\◊\‘¿¥\Ê\Íës]˚\ˆ\≈ay','4357192299','Visit Arches to discover a landscape of contrasting colors, land forms and textures unlike any other in the world. The park has over 2,000 natural stone arches, in addition to hundreds of soaring pinnacles, massive fins and giant balanced rocks. This red-rock wonderland will amaze you with its formations, refresh you with its trails, and inspire you with its sunsets.','Arches National Park','UT','Arches National Park is generally open 24 hours a day, year-round. Fees apply. The park is very busy between March and October. To avoid traffic, we recommend entering the park before 8 am or after 3 pm.'),(_binary 'µ\◊˚–¥\Ê\Íës]˚\ˆ\≈ay','9706412337','Big enough to be overwhelming, still intimate enough to feel the pulse of time, Black Canyon of the Gunnison exposes you to some of the steepest cliffs, oldest rock, and craggiest spires in North America. With two million years to work, the Gunnison River, along with the forces of weathering, has sculpted this vertical wilderness of rock, water, and sky.','Black Canyon Of The Gunnison National Park','CO','Open every day. The South Rim Road is open to vehicles from early April to mid-November. In winter, the South Rim Road is open to Gunnison Point. The remainder of the road is closed to vehicles, but open to cross country skiing and snowshoeing.'),(_binary 'µ\ÿ\"\‡¥\Ê\Íës]˚\ˆ\≈ay','5757852232','High ancient sea ledges, deep rocky canyons, flowering cactus, and desert wildlife‚Äîtreasures above the ground in the Chihuahuan Desert. Hidden beneath the surface are more than 119 caves‚Äîformed when sulfuric acid dissolved limestone leaving behind caverns of all sizes.','Carlsbad Caverns National Park','NM','Last entrance ticket sold: 1:45 pm    /    Hike INTO the cavern: 8:30 am‚Äì2:00 pm    /    Elevators: Due to social distancing, elevator use is only permitted for exiting the cavern.'),(_binary 'µ\ÿ\"\·¥\Ê\Íës]˚\ˆ\≈ay','5415943000','Crater Lake inspires awe. Native Americans witnessed its formation 7,700 years ago, when a violent eruption triggered the collapse of a tall peak. Scientists marvel at its purity: fed by rain and snow, it‚Äôs the deepest lake in the USA and one of the most pristine on earth. Artists, photographers, and sightseers gaze in wonder at its blue water and stunning setting atop the Cascade Mountain Range.','Crater Lake National Park','OR','Crater Lake National Park is open year-round, 24 hours a day. Some roads, trails, and facilities, however, are closed seasonally due to snow. Much of the year, the park‚Äôs North Entrance Road and Rim Drive are closed to cars. They close for the season on November 1 (or earlier if there is significant snowfall). Crews begin removing snow from these roads in April, but opening dates vary. The North Entrance Road and West Rim Drive tend to open in early June. The East Rim Drive typically opens in early July.'),(_binary 'µ\ÿI\¥\Ê\Íës]˚\ˆ\≈ay','3146551600','The Gateway Arch reflects St. Louis\' role in the Westward Expansion of the United States during the nineteenth century. The park is a memorial to Thomas Jefferson\'s role in opening the West, to the pioneers who helped shape its history, and to Dred Scott who sued for his freedom in the Old Courthouse.','Gateway Arch National Park','MO','The Gateway Arch is open year-round, closed only on Thanksgiving, Christmas, and New Year‚Äôs Day. Summer Hours run the Saturday before Memorial Day through Labor Day weekend. Winter Hours run the Tuesday after Labor Day through the Friday before Memorial Day weekend. Summer Hours for the Gateway Arch are 8am-10pm and Winter Hours are 9am-6pm'),(_binary 'µ\ÿq\0¥\Ê\Íës]˚\ˆ\≈ay','4068887800','Come and experience Glacier\'s pristine forests, alpine meadows, rugged mountains, and spectacular lakes. With over 700 miles of trails, Glacier is a hiker\'s paradise for adventurous visitors seeking wilderness and solitude. Relive the days of old through historic chalets, lodges, and the famous Going-to-the-Sun Road. Explore Glacier National Park and discover what awaits you.','Glacier National Park','MT','Glacier National Park is open 24 hours a day 365 days of the year. An entrance fee is required, even when the entrance stations are not staffed. Instructions are available at each entrance for self-payment.'),(_binary 'µÿò¥\Ê\Íës]˚\ˆ\≈ay','5305954480','Lassen Volcanic National Park is home to steaming fumaroles, meadows freckled with wildflowers, clear mountain lakes, and numerous volcanoes. Jagged peaks tell the story of its eruptive past while hot water continues to shape the land. Lassen Volcanic offers opportunities to discover the wonder and mysteries of volcanoes and hot water for visitors willing to explore the undiscovered.','Lassen Volcanic National Park','CA','The park is always open. Road access is limited during the winter season, approximately November through May, due to snow.'),(_binary '¿\˜\0¥\Ê\Íës]˚\ˆ\≈ay','3052427700','Everglades National Park protects an unparalleled landscape that provides important habitat for numerous rare and endangered species like the manatee,  American crocodile, and the elusive Florida panther.\n\nAn international treasure as well -  a World Heritage Site, International Biosphere Reserve, a Wetland of International Importance, and a specially protected area under the Cartagena Treaty.','Everglades National Park','FL','Everglades National Park is open 7 days a week, 24 hours a day. Park entrance is always open but staffed from 8:00 a.m. to 4:30 p.m.'),(_binary '¿\˜F¥\Ê\Íës]˚\ˆ\≈ay','7752347331','From the 13,063-foot summit of Wheeler Peak, to the sage-covered foothills, Great Basin National Park is a place to sample the stunning diversity of the larger Great Basin region. Come and partake of the solitude of the wilderness, walk among ancient bristlecone pines, bask in the darkest of night skies, and explore mysterious subterranean passages. There\'s a whole lot more than just desert here!','Great Basin National Park','NV','Park Grounds and Trails'),(_binary '¿\˜F¥\Ê\Íës]˚\ˆ\≈ay','9158283251','Guadalupe Mountains National Park protects the world\'s most extensive Permian fossil reef, the four highest peaks in Texas, an environmentally diverse collection of flora and fauna, and the stories of lives shaped through conflict, cooperation and survival. Come experience mountains and canyons, desert and dunes, night skies and spectacular vistas within a place unlike any other within the NPS.','Guadalupe Mountains National Park','TX','The Pine Springs Visitor Center is open year round for visitors and is only closed on December 25th. Visitors can tour the museum, watch the park slide show, and obtain park maps and brochures for their visit.'),(_binary '¿\˜m ¥\Ê\Íës]˚\ˆ\≈ay','5016206715','Hot Springs National Park has a rich cultural past. The grand architecture of our historic bathhouses is equally matched by the natural curiosities that have been drawing people here for hundreds of years. Ancient thermal springs, mountain views, incredible geology, forested hikes, and abundant creeks ‚Äì all in the middle of town ‚Äì make Hot Springs National Park a unique and beautiful destination.','Hot Springs National Park','AR','Arlington Lawn, Grand Promenade, sidewalks on Bathhouse Row, Reserve Street, and Fountain Street except for walk through traffic are open from to 5:00 am to 10:00 pm.\nThe porches and lawns on Bathhouse Row, except as authorized by contract, lease or special use permits with the National Park Service. \nRoads to Hot Springs Mountain, North Mountain and West Mountain Summit are open to vehicle traffic from 8:00 am to 10:00 pm.\nVisitor center hours are listed below.'),(_binary '¿\˜î0¥\Ê\Íës]˚\ˆ\≈ay','2193951882','Indiana Dunes National Park hugs 15 miles of the southern shore of Lake Michigan and has much to offer. Whether you enjoy scouting for rare species of birds or flying kites on the sandy beach, the national park\'s 15,000 acres will continually enchant you.  Hikers will enjoy 50 miles of trails over rugged dunes, mysterious wetlands, sunny prairies, meandering rivers and peaceful forests.','Indiana Dunes National Park','IN','Park areas are open from 6:00 am to 11:00 pm Central Time unless otherwise posted.\n\nThe Indiana Dunes Visitor Center is open everyday with the exception of Thanksgiving Day, Christmas Day, and New Year\'s Day. Summer hours are 8:00 am to 6:00 pm Central Time (Friday of Memorial Day weekend through Monday of Labor Day weekend). Winter hours are 8:30 am to 4:30 pm Central Time.'),(_binary '¿\˜î1¥\Ê\Íës]˚\ˆ\≈ay','3407766201','Virgin Islands National Park is more than just beautiful beaches. Hike to plantation ruins to learn about a time when sugar dominated the island. Visit the ancient petroglyphs carved by the Taino Indians. Come snorkel the coral reefs to discover hidden marine life.  Two-thirds of the island of St. John is national park, making it a unique destination for visitors from around the world.','Virgin Islands National Park','VI','Important Shutdown Notice\nBecause of the federal government shutdown, this website is not being updated and may not reflect current conditions. For your planning purposes, some parks in the National Park System may have areas that remain accessible to visitors; however access may change without notice, and some parks are closed completely. \n\n\nThe Virgin Islands National Park is always open. Visitor Center and store are open 8:30 a.m. until 4:30 p.m. Daily. Closed Fourth of July, Thanksgiving and Christmas.'),(_binary '¿\˜ª@¥\Ê\Íës]˚\ˆ\≈ay','307-344-7381','On March 1, 1872, Yellowstone became the first national park for all to enjoy the unique hydrothermal wonders. Today, millions of people come here each year to camp, hike, and enjoy the majesty of the park.','Yellowstone National Park','ID','Yellowstone is open daily, year-round, although activities and services are limited at night and certain times of year. The park has five entrance stations, but not all entrance stations are open year-round. Make sure to carefully read about access at each station at different times of year. And remember, all dates are weather-dependent.\n\nPlease note that camping is possible only in designated campgrounds.'),(_binary '\Ã*P¥\Ê\Íës]˚\ˆ\≈ay','2072883338','Acadia National Park protects the natural beauty of the highest rocky headlands along the Atlantic coastline of the United States, an abundance of habitats, and a rich cultural heritage. At 3.5 million visits a year, it\'s one of the top 10 most-visited national parks in the United States. Visitors enjoy 27 miles of historic motor roads, 158 miles of hiking trails, and 45 miles of carriage roads.','Acadia National Park','ME','In support of federal, state, and local efforts to slow the spread of the novel coronavirus (COVID-19), the park is under a phased reopening. The Park Loop Road and most hiking trails are open. Information stations are staffed outside main visitor center. Carriage Roads are closed to bicycles and horses. Campgrounds open no sooner than July 1. Gatherings of more than 50 people are prohibited.'),(_binary '\Ã*?`¥\Ê\Íës]˚\ˆ\≈ay','3052301144','Within sight of downtown Miami, yet worlds away, Biscayne protects a rare combination of aquamarine waters, emerald islands, and fish-bejeweled coral reefs. Here too is evidence of 10,000 years of human history, from pirates and shipwrecks to pineapple farmers and presidents. Outdoors enthusiasts can boat, snorkel, camp, watch wildlife‚Ä¶or simply relax in a rocking chair gazing out over the bay.','Biscayne National Park','FL','Park waters are open 24 hours a day, all year.'),(_binary '\Ã*fp¥\Ê\Íës]˚\ˆ\≈ay','8037764396','Astonishing biodiversity exists in Congaree National Park, the largest intact expanse of old growth bottomland hardwood forest remaining in the southeastern United States. Waters from the Congaree and Wateree Rivers sweep through the floodplain, carrying nutrients and sediments that nourish and rejuvenate this ecosystem and support the growth of national and state champion trees.','Congaree National Park','SC','The park is open but some trails (Boardwalk Trail, portions of Weston Lake Loop Trail) and all facilities remain closed. This includes the visitor center, campgrounds, and restrooms.'),(_binary '\Ã*çÄ¥\Ê\Íës]˚\ˆ\≈ay','7607863200','In this below-sea-level basin, steady drought and record summer heat make Death Valley a land of extremes. Yet, each extreme has a striking contrast. Towering peaks are frosted with winter snow. Rare rainstorms bring vast fields of wildflowers. Lush oases harbor tiny fish and refuge for wildlife and humans. Despite its morbid name, a great diversity of life survives in Death Valley.','Death Valley National Park','CA','The park is open daily all year. Certain roads, facilities, and areas may be closed due to COVID-19.'),(_binary '\Ã*çÅ¥\Ê\Íës]˚\ˆ\≈ay','928-638-7888','Located in Arizona, Grand Canyon National Park encompasses 277 miles (446 km) of the Colorado River and adjacent uplands. The park is home to much of the immense Grand Canyon; a mile (1.6 km) deep, and up to 18 miles (29 km) wide. Layered bands of colorful rock reveal millions of years of geologic history. Grand Canyon is unmatched in the incomparable vistas it offers visitors from the rim.','Grand Canyon National Park','AZ','The South Rim is Open with Some Visitor Services and Overnight Accommodations.\nNote: The East Entrance to the park at Desert View, and the Desert View Watchtower area is CLOSED because of COVID-19 concerns. You must use the South Entrance near the town of Tusayan to enter and exit the park.'),(_binary '\Ã*¥ê¥\Ê\Íës]˚\ˆ\≈ay','2707582180','Mammoth Cave National Park preserves not only the cave system, but also 53,000 acres of beautiful forest.  With the world\'s longest cave (400+ miles) below ground, and a surface boasting nearly 70 miles of nature trail, 13 backcountry campsites, three campgrounds, and over 20 miles of navigable river to explore and enjoy, it really is two worlds in one.','Mammoth Cave National Park','KY','Mammoth Cave National Park is open 24-hours a day, although services are limited after-hours (generally after 4:30 pm in winter or 5 pm in summer). There is no gate at the park entrance. Please note that camping is only possible either in designated campgrounds or backcountry campsites with a valid reservation or permit.'),(_binary '\Ã*€†¥\Ê\Íës]˚\ˆ\≈ay','5415922100','Deep within the Siskiyou Mountains are dark, twisting passages that await your discovery.  Eons of acidic water seeping into marble rock created and decorated the wondrous ‚ÄúMarble Halls of Oregon.‚Äù Join a tour, get a taste of what caving is all about, and explore a mountain from the inside and out!','Oregon Caves National Monument & Preserve','OR','Spring tours are available Thursday thru Monday 10 am to 4 pm (March 25 - May 4).\n*** NO cave tours offered on Tuesdays and Wednesdays during this time ***\n\nLate spring tours are availabe daily 10 am to 4 pm (May 5 - May 26).\n\nClosed in the winter.'),(_binary '\÷E\’@¥\Ê\Íës]˚\ˆ\≈ay','8313894486','Some 23 million years ago multiple volcanoes erupted, flowed, and slid to form what would become Pinnacles National Park. What remains is a unique landscape. Travelers journey through chaparral, oak woodlands, and canyon bottoms. Hikers enter rare talus caves and emerge to towering rock spires teeming with life: prairie and peregrine falcons, golden eagles, and the inspiring California condor.','Pinnacles National Park','CA','Entrance to the east side of Pinnacles National Park is always open.'),(_binary '\÷E\’A¥\Ê\Íës]˚\ˆ\≈ay','5409993500','Just 75 miles from the bustle of Washington, D.C., Shenandoah National Park is a land bursting with cascading waterfalls, spectacular vistas, fields of wildflowers, and quiet wooded hollows. With over 200,000 acres of protected lands that are haven to deer, songbirds, and black bear, there\'s so much to explore...and your journey begins right here!','Shenandoah National Park','VA','Shenandoah National Park is always open. However, portions of Skyline Drive, the only public road through the park, are periodically closed during inclement weather. Visitors can still enter the park on foot to hike even when the Drive is closed.'),(_binary '\‚1p¥\Ê\Íës]˚\ˆ\≈ay','9072463305','Given its remote location and challenging weather conditions, Aniakchak is one of the most wild and least visited places in the National Park System. This landscape is a vibrant reminder of Alaska\'s location in the volcanically active \"Ring of Fire,\" as it is home to an impressive six mile (10 km) wide, 2,500 ft (762 m) deep caldera formed during a massive volcanic eruption 3,500 years ago.','Aniakchak National Monument & Preserve','AK','Aniakchak National Monument is a truly primitive environment with no federally-maintained public facilities. The NPS imposes no operating hours or seasonal restrictions. Access to and movement within Aniachak, however, may be limited or restricted at any time depending upon prevailing weather conditions.'),(_binary '\‚XÄ¥\Ê\Íës]˚\ˆ\≈ay','2085271300','Craters of the Moon is a vast ocean of lava flows with scattered islands of cinder cones and sagebrush. We invite you to explore this \"weird and scenic landscape\" where yesterday\'s volcanic events are likely to continue tomorrow.','Craters Of The Moon National Monument & Preserve','ID','Visitor Center parking lot is always open but other roads may be closed or impassable to motor vehicles due to snow from late November through late April. High clearance four-wheel drive highly recommended on BLM Monument roads.'),(_binary '\‚XÅ¥\Ê\Íës]˚\ˆ\≈ay','3077393399','Rising above a scene rich with extraordinary wildlife, pristine lakes, and alpine terrain, the Teton Range stands as a monument to the people who fought to protect it. These are mountains of the imagination. Mountains that led to the creation of Grand Teton National Park where you can explore over two hundred miles of trails, float the Snake River, and enjoy the serenity of this remarkable place.','Grand Teton National Park','WY','Visitors may enter the park at any time, but visitor services and motor vehicle access vary throughout the year.'),(_binary '\‚ê¥\Ê\Íës]˚\ˆ\≈ay','5207335153','Tucson, Arizona is home to the nation\'s largest cacti. The giant saguaro is the universal symbol of the American west. These majestic plants, found only in a small portion of the United States, are protected by Saguaro National Park, to the east and west of the modern city of Tucson. Here you have a chance to see these enormous cacti, silhouetted by the beauty of a magnificent desert sunset.','Saguaro National Park','AZ','In the Tucson Mountain District (west), the park is open to vehicles from sunrise to sunset daily. (Actual times vary throughout the year).\nThe Rincon Mountain District (east), the park is open to vehicles from 7:00 a.m. (if staffing permits, gates may open earlier) to sunset daily.\nYou can walk or bike into the park 24 hours a day.\nVisitor Center - Both Districts are open 364 days per year.\nOperating Hours: Monday - Sunday 9:00 a.m. to 5:00 p.m. (closed Christmas day)'),(_binary '\‚ë¥\Ê\Íës]˚\ˆ\≈ay','6057454600','Bison, elk, and other wildlife roam the rolling prairie grasslands and forested hillsides of one of America\'s oldest national parks. \n\nBelow the remnant island of intact prairie sits Wind Cave, one of the longest and most complex caves in the world. Named for barometric winds at its entrance, this maze of passages is home to boxwork, a unique formation rarely found elsewhere.','Wind Cave National Park','SD','The park is open all day, every day. Snow or severe weather can limit access to some areas of the park, especially in winter. Visitor Center hours and cave tour schedules vary throughout the year. \n\nVisit the park website or call 605.745.4600 for current conditions.'),(_binary '\Ï7Ç@¥\Ê\Íës]˚\ˆ\≈ay','435-425-3791','Located in south-central Utah in the heart of red rock country, Capitol Reef National Park is a hidden treasure filled with cliffs, canyons, domes, and bridges in the Waterpocket Fold, a geologic monocline (a wrinkle on the earth) extending almost 100 miles.','Capitol Reef National Park','UT','Capitol Reef is a 24 hour park, open all day, every day. The visitor center is open daily (except for some major holidays) from 8:00 a.m. to 4:30 p.m. with extended hours spring through the fall.'),(_binary '\Ï7©P¥\Ê\Íës]˚\ˆ\≈ay','8089856000','Hawai‚Äòi Volcanoes National Park protects some of the most unique geological, biological, and cultural landscapes in the world. Extending from sea level to 13,677 feet, the park encompasses the summits of two of the world\'s most active volcanoes - Kƒ´lauea and Mauna Loa.','Hawai\'i Volcanoes National Park','HI','Hawai‚Äòi Volcanoes National Park is open 7 days a week, 24 hours a day including holidays.'),(_binary '\˜:C–¥\Ê\Íës]˚\ˆ\≈ay','8654361200','Ridge upon ridge of forest straddles the border between North Carolina and Tennessee in Great Smoky Mountains National Park. World renowned for its diversity of plant and animal life, the beauty of its ancient mountains, and the quality of its remnants of Southern Appalachian mountain culture, this is America\'s most visited national park.','Great Smoky Mountains National Park','NC','Primary roads are open 24 hours a day, seven days a week, year-round, weather permitting. This includes Newfound Gap Road (US-441), Little River Road, and Laurel Creek Road. Secondary roads are closed seasonally.'),(_binary '\˜:j\‡¥\Ê\Íës]˚\ˆ\≈ay','8085724400','This special place vibrates with stories of ancient and modern Hawaiian culture and protects the bond between the land and its people. The park also cares for endangered species, some of which exist nowhere else. Come visit this special place - renew your spirit amid stark volcanic landscapes and sub-tropical rain forest with an unforgettable hike through the backcountry.','Haleakal&#257; National Park','HI','Phased Reopening with limited areas in the Summit District open daily from 9:00 am to 5:00 pm.'),(_binary '\˜:ë\¥\Ê\Íës]˚\ˆ\≈ay','970-529-4465','Mesa Verde National Park was established in 1906 to preserve and interpret the archeological heritage of the Ancestral Pueblo people who made it their home for over 700 years, from 600 to 1300 CE. Today, the park protects nearly 5,000 known archeological sites, including 600 cliff dwellings. These sites are some of the most notable and best preserved in the United States.','Mesa Verde National Park','CO','The park is open, but services are limited. For more information, please visit https://www.nps.gov/meve/planyourvisit/ops_updates_covid19.htm.'),(_binary '\˜:π\0¥\Ê\Íës]˚\ˆ\≈ay','3608547200','Less than three hours from Seattle, an alpine landscape beckons. Discover communities of life adapted to moisture in the west and recurring fire in the east. Explore jagged peaks crowned by more than 300 glaciers. Listen to cascading waters in forested valleys. Witness a landscape sensitive to the Earth\'s changing climate. Help steward the ecological heart of the Cascades.','North Cascades National Park','WA','North Cascades National Park Service Complex is open year-round. The park operational season is late May-late September, with limited services outside the operational season. The North Cascades Visitor Center in Newhalem, and the Golden West Visitor Center in Stehekin, are open late-May-September.'),(_binary '\˜:\‡¥\Ê\Íës]˚\ˆ\≈ay','3605653130','With its incredible range of precipitation and elevation, diversity is the hallmark of Olympic National Park. Encompassing nearly a million acres, the park protects a vast wilderness, thousands of years of human history, and several distinctly different ecosystems, including glacier-capped mountains, old-growth temperate rain forests, and over 70 miles of wild coastline. Come explore!','Olympic National Park','WA','Olympic National Park is open 24 hours a day year-round, although some roads, campgrounds and facilities are open seasonally.'),(_binary '\˜:\‡¥\Ê\Íës]˚\ˆ\≈ay','2182836600','Voyageurs is a maze of interconnected water highways. Plan ahead before coming to this water-based park by bringing your own watercraft, reserving a watercraft, or taking a park ranger boat tour.','Voyageurs National Park','MN','Voyageurs is open 24-hours a day year-round, although activities and services are limited after visitor center hours.  Please note that early spring and late fall may present hazards on the lake with thin ice; use caution.');
